import React, { Component } from 'react';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
     list: [{name:'sanjan',
             age:25,
             username:'sanj31'},
             {name:'saloni',
             age:25,
             username:'sal45'}],
      mydata: "test"
  }
}
  render() {
   const {list, mydata} = this.state;
    // const list = this.stat.list;
    // const myData = this.state.myData;

    return (
      <div>
        {mydata}
        <ul>
           {list.map((item, idx) => {
             console.log(idx,item)
             return (
              <li key={idx}>{item.name} {item.age} {item.username}</li>
            )}
          )}
        </ul>

      </div>
    );
  }
}
export default App;
